"""# Questão 02 - Tempo de um Trajeto

Os melhores trajetos de uma estação para outra são aqueles que possuem o menor tempo de deslocamento dentro dos trens e envolvem um número pequeno de trocas de trem. Caso o passageiro precise trocar de trem, isto levará um tempo que deve ser adicionado ao tempo total de trajeto: um tempo médio de *t* minutos para ele deixar um trem, se deslocar até o ponto de pegar o próximo trem, aguardar sua chegada e embarcar. Existe também o tempo necessário ao embarque inicial que envolve o deslocamento do passageiro da rua até o ponto de embarque, a espera pelo trem e o embarque. Por simplicidade, vamos considerar, neste exercício, que o tempo médio de embarque inicial é equivalente ao tempo médio para a troca de trem. Note que cada aresta do grafo possui um peso associado que é o tempo que o trem leva para se deslocar de uma estação para a outra, onde as estações são os terminais da aresta. Algumas linhas que passam pelo trilho podem ser mais rápidas que outras devido as diferenças entre equipamentos e capacidades.  

Implemente a função, *tempo_estimado*, que recebe como entrada o grafo, o seu dicionário de arestas, uma instância de *Graphpath* representando um trajeto no grafo e uma estimativa de tempo *t* de troca/embarque de trem. O tempo t é acrescido de *3* sempre que a estação onde a troca é feita for central, considerando que 3 ou mais linhas passam por ela. A função retorna a estimativa de tempo para o trajeto a qual deve considerar o tempo para embarque, tempo de descolamento do trem entre cada par de estações e tempo de trocas de trem, caso existam. Note que as trocas ocorrem quando o trajeto passa a usar uma linha diferente da que está sendo percorrida.

Como exemplo, vamos considerar o grafo **g1** e o deslocamento da estação *Cruzeiro* para *Centenário*. Um possível trajeto é Trajeto:

['Cruzeiro--l:3,t:1.0->>Prata',

'Prata--l:1,t:2.0->>Catolé',

'Catolé--l:2,t:1.0->>Centenário'].

Sendo t = 5, o tempo estimado para o trajeto retornado é:

5.0 (embarque inicial) + 1.0 (peso aresta) +

5.0 (troca de trem) + 3.0 (Troca em Prata: estação central) + 2.0 (peso aresta) +

5.0 (troca de trem) + 3.0 (Troca em Catolé: estação central) + 1.0 (peso aresta)

= 25min
"""

from jgrapht.algorithms.shortestpaths import yen_k_loopless

def tempo_estimado (g,e_g,graphpath,t):
  if graphpath == None or t <0 or e_g == {} or e_g ==  None or g ==None:
    return None
  resposta = 0.0
  centrais = 0
  soma = 1
  if len(graphpath.edges)== 0 :
    return 0
  linhaAtual = e_g.get(graphpath.edges[0]).get("line")
  dici = estacoes_centrais(g,e_g,3)

  for a in range(len(graphpath.edges)):
    if e_g[graphpath.edges[a]].get('time') != None:
      resposta = resposta + int(e_g[graphpath.edges[a]].get("time"))

    else:
      resposta += g.get_edge_weight(graphpath.edges[a])

    if e_g[graphpath.edges[a]].get("line") != linhaAtual:
      soma +=1
      linhaAtual = e_g[graphpath.edges[a]].get("line")
      if g.edge_tuple(graphpath.edges[a])[0] in g.edge_tuple(graphpath.edges[a-1]):
        if dici.get(g.edge_tuple(graphpath.edges[a])[0]) != None:
          centrais +=1
      elif g.edge_tuple(graphpath.edges[a])[1] in g.edge_tuple(graphpath.edges[a-1]):
        if dici.get(g.edge_tuple(graphpath.edges[a])[1]) != None:
          centrais +=1


  resposta += soma * t
  resposta += centrais * 3
  return resposta

