def estacoes (g,v_g,e_g,l):
  # Este código não deve ser alterado
  if (g is None) or e_g == {}:
    return None
  elist = []
  for e in g.edges:
    if e_g[e]['line']==l:
      elist.append(e)
  from jgrapht.views import as_masked_subgraph
  vlist = {g.edge_source(elist[0]),g.edge_target(elist[0])}
  for i in range(1,len(elist)):
    vlist.add(g.edge_target(elist[i]))
  return set({v_g[v]['label'] for v in vlist})

